import React from 'react'

const CheerfulUsers = (props) => {
    return (
        <div className={sass.cheerfulUsers}>
            <h2 className={sass.usersTitle}>Our cheerful users</h2>
            <p className={sass.usersSubtitle}>Attention! Sorting users by registration date</p>
            <div className={sass.userCards}>

            </div>
            <button className={sass.usersButton}>Show more</button>
        </div>
    )
}

export default CheerfulUsers
